film_scrape = []
rates_scrape = []
def scrape(film_lst):
    for f in film_lst:
        film = 'https://letterboxd.com' + f
        filmRep = requests.get(film)
        filmsoup = bs4.BeautifulSoup(filmRep.text, 'html.parser')
        filminfo = filmsoup.find_all(type='application/ld+json')[0].string
        index1 = filminfo.find('{')
        index2 = filminfo.find('/*', index1+1)
        filminfo = filminfo[index1:index2]
        filmjson = json.loads(filminfo)
        try: dr = filmjson['director'][0]['name']
        except: dr = 'Unknown'
        yr = filmjson['releasedEvent'][0]['startDate']
        rc = filmjson['aggregateRating']['ratingCount']
        try: gl = filmjson['genre']
        except: gl = ['Unknown']
        try: ctry = filmjson['countryOfOrigin'][0]['name']
        except: ctry = 'Unknown'
        tt = filmjson['name']
        #first append
        film_scrape.append([tt,dr,yr,rc,gl,ctry])
        filmrates = 'https://letterboxd.com/csi' + f + 'rating-histogram'
        ratesRep = requests.get(filmrates)
        ratesoup = bs4.BeautifulSoup(ratesRep.text, 'html.parser')
        ratesoup = ratesoup.div.ul.find_all('li')
        rate_lst = []
        for i in list(range(10)):
            try:
                scr = ratesoup[i].a['title'].split(' ')[0]
                amt = ''.join(filter(str.isdigit,scr))
                rate_lst.append(int(amt))
            except:
                rate_lst.append(0)
        #second append
        rates_scrape.append(rate_lst)

